  false,\n\t\"url\": null,\n\t\"notes\": \"The accession contains data gathered over
  a period of nine years bynvarious agencies from the US, Britain and Federal Republic
  of Germanyn(FRG). Data was collected between July 2, 1969 and March 2,1978.nMultiple
  German ships such as ANTON DOHRN, GAUSS, FRIEDRICH HEINCKE,nWALTER KOERTE, METEOR,
  VICTOR HENSEN and unknown platforms were used toncollect the data. Water depth and
  other data were collected using a number ofnsampling devices such as bottle, BathyThermograph
  (BT), MechanicalnBathyThermograph (MBT), meteorological sensors, secchi diski andneXpendable
  Bathy Thermograph (XBT). XBT data collected by R/V METEOR betweennMarch 3-7, 1977
